  false,\n\t\"url\": null,\n\t\"notes\": \"This Digital Elevation Model (DEM) dataset,
  published at 1:600 (1in=50ft) scale, was produced all or in part from Orthoimagery
  information as of 2005. It is described as 'A digital elevation model represents
  continuous elevation values over a topographic surface by a regular array of z-values
  referenced to a common datum and typically used to represent terrain relief.'. Data
  by this publisher are often provided in State Plane coordinate system; in a Lambert
  Conformal-conic projection; The extent of these data is generally Frederick County,
  MD. The approximate post spacing interval used in the production of this layer is
  5 meter. It will support a 2 feet contour interval. These data include break lines
  Control monumentation used to create these data are available. This metadata was
  auto-generated through the Ramona GIS Inventory System (www.gisinventory.net) and
  does not represent all information about this data set.\",\n\t\"license_title\":
